import Link from 'next/link';

type JobProps = {
  title: string;
  id: string;
  type: 'job' | 'article';
}

export const ListingView = ({ title, id, type }: JobProps) => (
  <li>
    <Link href={`/${type}/[id]`} as={`/${type}s/${id}`}>
      <a>{title}</a>
    </Link>
  </li>
)

export default JobView
